                    Eigen::Matrix<T__,Eigen::Dynamic,1>  pGo(static_cast<Eigen::VectorXd::Index>(4));
                    (void) pGo;  // dummy to suppress unused var warning
                    stan::math::initialize(pGo, DUMMY_VAR__);
