                        stan::math::assign(get_base1_lhs(log_lik,i,"log_lik",1), (get_base1(log_lik,i,"log_lik",1) + categorical_logit_log(get_base1(get_base1(choice,i,"choice",1),(t + 1),"choice",2),multiply(ev,get_base1(beta,i,"beta",1)))));
